import React from "react";

const NavBar = () => {
  return (
    <div>
      <h1>WELCOME TO MY SHOP</h1>
      <nav>
        <div>
          <ul>
            <li>home</li>
            <li>About</li>
            <li>Product</li>
            <li>Pr</li>
          </ul>
        </div>
      </nav>
    </div>
  );
};

export default NavBar;
